INSERT INTO `page_block` VALUES (791, 'Team status', 'report_view', '{\"datasource\":\"SELECT c.full_name as user, SUM(CASE WHEN is_completed =1 THEN \'1\' ELSE \'0\' END) AS \\\"closed\\\", SUM(CASE WHEN is_completed <>1 THEN \'1\' ELSE \'0\' END) AS \\\"open\\\", SUM(CASE WHEN is_completed =0 AND end_date<date(NOW())THEN \'1\' ELSE \'0\' END) AS \\\"overdue\\\", SUM(CASE WHEN is_completed =0 AND date(end_date)=date(NOW())THEN \'1\' ELSE \'0\' END) AS \\\"today\\\" FROM project_activity_entity pa JOIN user_entity c on c.id = pa.assigned_to_id WHERE project_id={id} and pa.entity_state_id=1 GROUP BY pa.assigned_to_id ORDER BY full_name \",\"definition\":\"<table class=\\\"table table-striped table-bordered datatables fixed-columns dataTable no-footer\\\"> <thead class=\\\"sp-table-header\\\"> <tr> <th>User<\\/th> <th>Closed<\\/th> <th>Open<\\/th> <th>Overdue<\\/th> <th>Due Today<\\/th> <\\/tr> <\\/thead> <tbody> {% for item in data.items %} <tr class=\\\"sp-row-clickable\\\"> <td> {{ item.user }}<\\/td> <td> {{ item.closed}}<\\/td> <td> {{ item.open }}<\\/td> <td> {{ item.overdue }}<\\/td> <td> {{ item.today }}<\\/td> <\\/tr> {% endfor %} <\\/tbody> <\\/table>\"}', NULL, NULL, NULL, NULL, NULL, '2019-08-02 15:41:59', '2020-02-08 21:17:22', 'ProjectManagementBusinessBundle', '647b17c2955ec831550b609cef20e5c7', 'e099bd017aebd385905a622520276879', 0);
