INSERT INTO `page_block` VALUES (1610, 'Sales per months', 'bar_chart', '{\"source\":\" SELECT s.invoice_year as year, SUM(IF (s.invoice_month = 1, for_pay,0)) AS Jan, SUM(IF (s.invoice_month = 2, for_pay,0)) AS Feb, SUM(IF (s.invoice_month = 3, for_pay,0)) AS Mar, SUM(IF (s.invoice_month = 4, for_pay,0)) AS Apr, SUM(IF (s.invoice_month = 5, for_pay,0)) AS May, SUM(IF (s.invoice_month = 6, for_pay,0)) AS Jun, SUM(IF (s.invoice_month = 7, for_pay,0)) AS Jul, SUM(IF (s.invoice_month = 8, for_pay,0)) AS Aug, SUM(IF (s.invoice_month = 9, for_pay,0)) AS Sep, SUM(IF (s.invoice_month = 10, for_pay,0)) AS Oct, SUM(IF (s.invoice_month = 11, for_pay,0)) AS Nov, SUM(IF (s.invoice_month = 11, for_pay,0)) AS Decm FROM( SELECT YEAR (i.created) AS invoice_year, MONTH (i.created) AS invoice_month, ii.base_price_total as for_pay FROM order_entity i JOIN order_item_entity ii on ii.order_id=i.id JOIN product_entity p on p.id=ii.product_id WHERE i.account_id =:id )s GROUP BY s.invoice_year\",\"xaxis\":[\"year\"],\"yaxis\":[{\"field\":\"Jan\",\"label\":\"Jan\",\"aggregate\":\"SUM\"},{\"field\":\"Feb\",\"label\":\"Feb\",\"aggregate\":\"SUM\"},{\"field\":\"Mar\",\"label\":\"Mar\",\"aggregate\":\"SUM\"},{\"field\":\"Apr\",\"label\":\"Apr\",\"aggregate\":\"SUM\"},{\"field\":\"May\",\"label\":\"May\",\"aggregate\":\"SUM\"},{\"field\":\"Jun\",\"label\":\"Jun\",\"aggregate\":\"SUM\"},{\"field\":\"Jul\",\"label\":\"Jul\",\"aggregate\":\"SUM\"},{\"field\":\"Aug\",\"label\":\"Aug\",\"aggregate\":\"SUM\"},{\"field\":\"Sep\",\"label\":\"Sep\",\"aggregate\":\"SUM\"},{\"field\":\"Oct\",\"label\":\"Oct\",\"aggregate\":\"SUM\"},{\"field\":\"Nov\",\"label\":\"Nov\",\"aggregate\":\"SUM\"},{\"field\":\"Decm\",\"label\":\"Decm\",\"aggregate\":\"SUM\"}],\"filters\":\"\"}', NULL, NULL, 382, NULL, NULL, '2020-05-05 22:03:29', '2020-05-05 22:03:29', 'CrmBusinessBundle', '10ff93fbd5731f71d99fec239a04ccfe', '6c00690c20af672f50acd11192329a1a', 0);
