INSERT INTO `page_block` VALUES (1936, 'Total number of orders per month', 'area_chart', '{\"source\":\"SELECT s.year, SUM( IF( s.monthnumber = 1, s.count, 0 ) ) AS Jan, SUM( IF( s.monthnumber = 2, s.count, 0 ) ) AS Feb, SUM( IF( s.monthnumber = 3, s.count, 0 ) ) AS Mar, SUM( IF( s.monthnumber = 4, s.count, 0 ) ) AS Apr, SUM( IF( s.monthnumber = 5, s.count, 0 ) ) AS May, SUM( IF( s.monthnumber = 6, s.count, 0 ) ) AS Jun, SUM( IF( s.monthnumber = 7, s.count, 0 ) ) AS Jul, SUM( IF( s.monthnumber = 8, s.count, 0 ) ) AS Aug, SUM( IF( s.monthnumber = 9, s.count, 0 ) ) AS Sep, SUM( IF( s.monthnumber = 10, s.count, 0 ) ) AS Oct, SUM( IF( s.monthnumber = 11, s.count, 0 ) ) AS Nov, SUM( IF( s.monthnumber = 12, s.count, 0 ) ) AS Decm FROM ( SELECT dd.year AS year, dd.monthnumber AS monthnumber, tf.order_total_count as count FROM shape_track_totals_fact tf JOIN shape_track_date_dim dd ON tf.date_dim_id = dd.id WHERE tf.store_id IN ({store_id}) AND dd.year > YEAR(CURDATE()) - 3 AND dd.year <= YEAR(CURDATE()))s GROUP BY s.year\",\"xaxis\":[\"year\"],\"yaxis\":[{\"field\":\"Jan\",\"label\":\"Jan\",\"aggregate\":\"SUM\"},{\"field\":\"Feb\",\"label\":\"Feb\",\"aggregate\":\"SUM\"},{\"field\":\"Mar\",\"label\":\"Mar\",\"aggregate\":\"SUM\"},{\"field\":\"Apr\",\"label\":\"Apr\",\"aggregate\":\"SUM\"},{\"field\":\"May\",\"label\":\"May\",\"aggregate\":\"SUM\"},{\"field\":\"Jun\",\"label\":\"Jun\",\"aggregate\":\"SUM\"},{\"field\":\"Jul\",\"label\":\"Jul\",\"aggregate\":\"SUM\"},{\"field\":\"Aug\",\"label\":\"Aug\",\"aggregate\":\"SUM\"},{\"field\":\"Sep\",\"label\":\"Sep\",\"aggregate\":\"SUM\"},{\"field\":\"Oct\",\"label\":\"Oct\",\"aggregate\":\"SUM\"},{\"field\":\"Nov\",\"label\":\"Nov\",\"aggregate\":\"SUM\"},{\"field\":\"Decm\",\"label\":\"Dec\",\"aggregate\":\"SUM\"}],\"filters\":[{\"field\":\"year\",\"label\":\"Year\",\"type\":\"multichoice\"}],\"orderby\":[\"year\"],\"tooltip\":\"Displays data back 3 years\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', '1ac45ab30ee5c875b18a4934c248501b', '47d9ec11fe6a0f443edfe2dffad2ef17', 0);
INSERT INTO `page_block` VALUES (1937, 'Avg order amount per month', 'area_chart', '{\"source\":\"SELECT s. YEAR, FORMAT( MAX( IF (s.monthnumber = 1, s.count, 0) ), 2 ) AS Jan, FORMAT( MAX( IF (s.monthnumber = 2, s.count, 0) ), 2 ) AS Feb, FORMAT( MAX( IF (s.monthnumber = 3, s.count, 0) ), 2 ) AS Mar, FORMAT( MAX( IF (s.monthnumber = 4, s.count, 0) ), 2 ) AS Apr, FORMAT( MAX( IF (s.monthnumber = 5, s.count, 0) ), 2 ) AS May, FORMAT( MAX( IF (s.monthnumber = 6, s.count, 0) ), 2 ) AS Jun, FORMAT( MAX( IF (s.monthnumber = 7, s.count, 0) ), 2 ) AS Jul, FORMAT( MAX( IF (s.monthnumber = 8, s.count, 0) ), 2 ) AS Aug, FORMAT( MAX( IF (s.monthnumber = 9, s.count, 0) ), 2 ) AS Sep, FORMAT( MAX( IF (s.monthnumber = 10, s.count, 0) ), 2 ) AS Oct, FORMAT( MAX( IF (s.monthnumber = 11, s.count, 0) ), 2 ) AS Nov, FORMAT( MAX( IF (s.monthnumber = 12, s.count, 0) ), 2 ) AS Decm FROM ( SELECT dd. YEAR AS YEAR, dd.monthnumber AS monthnumber, SUM(tf.order_total_amount) \\/ SUM(tf.order_total_count) AS count FROM shape_track_totals_fact tf JOIN shape_track_date_dim dd ON tf.date_dim_id = dd.id WHERE tf.store_id IN ({store_id}) AND dd. YEAR > YEAR (CURDATE()) - 3 AND dd. YEAR <= YEAR (CURDATE()) GROUP BY dd.year, dd.monthnumber ) s GROUP BY s. YEAR\",\"xaxis\":[\"year\"],\"yaxis\":[{\"field\":\"Jan\",\"label\":\"Jan\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Feb\",\"label\":\"Feb\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Mar\",\"label\":\"Mar\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Apr\",\"label\":\"Apr\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"May\",\"label\":\"May\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Jun\",\"label\":\"Jun\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Jul\",\"label\":\"Jul\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Aug\",\"label\":\"Aug\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Sep\",\"label\":\"Sep\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Oct\",\"label\":\"Oct\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Nov\",\"label\":\"Nov\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Decm\",\"label\":\"Dec\",\"aggregate\":\"SUM\",\"format\":\"currency\"}],\"filters\":\"\",\"orderby\":[\"year\"],\"tooltip\":\"Displays data back 3 years\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', '26232b52b1250ba4117de9cc4c222b94', '47d9ec11fe6a0f443edfe2dffad2ef17', 0);
INSERT INTO `page_block` VALUES (1938, 'Number of new registered users', 'area_chart', '{\"source\":\"SELECT CONCAT(s.contact_year, \\\" legal\\\") AS YEAR, SUM( IF (s.contact_month = 1, count, 0) ) AS Jan, SUM( IF (s.contact_month = 2, count, 0) ) AS Feb, SUM( IF (s.contact_month = 3, count, 0) ) AS Mar, SUM( IF (s.contact_month = 4, count, 0) ) AS Apr, SUM( IF (s.contact_month = 5, count, 0) ) AS May, SUM( IF (s.contact_month = 6, count, 0) ) AS Jun, SUM( IF (s.contact_month = 7, count, 0) ) AS Jul, SUM( IF (s.contact_month = 8, count, 0) ) AS Aug, SUM( IF (s.contact_month = 9, count, 0) ) AS Sep, SUM( IF (s.contact_month = 10, count, 0) ) AS Oct, SUM( IF (s.contact_month = 11, count, 0) ) AS Nov, SUM( IF (s.contact_month = 12, count, 0) ) AS Decm FROM ( SELECT YEAR (i.created) AS contact_year, MONTH (i.created) AS contact_month, 1 AS count FROM contact_entity i LEFT JOIN account_entity a ON i.account_id = a.id WHERE YEAR (i.created) >= YEAR (CURDATE()) AND core_user_id IS NOT NULL AND a.is_legal_entity = 1 ) s GROUP BY s.contact_year UNION SELECT CONCAT(s.contact_year, \\\" legal\\\") AS YEAR, SUM( IF (s.contact_month = 1, count, 0) ) AS Jan, SUM( IF (s.contact_month = 2, count, 0) ) AS Feb, SUM( IF (s.contact_month = 3, count, 0) ) AS Mar, SUM( IF (s.contact_month = 4, count, 0) ) AS Apr, SUM( IF (s.contact_month = 5, count, 0) ) AS May, SUM( IF (s.contact_month = 6, count, 0) ) AS Jun, SUM( IF (s.contact_month = 7, count, 0) ) AS Jul, SUM( IF (s.contact_month = 8, count, 0) ) AS Aug, SUM( IF (s.contact_month = 9, count, 0) ) AS Sep, SUM( IF (s.contact_month = 10, count, 0) ) AS Oct, SUM( IF (s.contact_month = 11, count, 0) ) AS Nov, SUM( IF (s.contact_month = 12, count, 0) ) AS Decm FROM ( SELECT YEAR (i.created) AS contact_year, MONTH (i.created) AS contact_month, 1 AS count FROM contact_entity i LEFT JOIN account_entity a ON i.account_id = a.id WHERE YEAR (i.created) >= YEAR (CURDATE()) - 1 AND YEAR (i.created) < YEAR (CURDATE()) AND core_user_id IS NOT NULL AND a.is_legal_entity = 1 ) s GROUP BY s.contact_year UNION SELECT CONCAT( s.contact_year, \\\" non legal\\\" ) AS YEAR, SUM( IF (s.contact_month = 1, count, 0) ) AS Jan, SUM( IF (s.contact_month = 2, count, 0) ) AS Feb, SUM( IF (s.contact_month = 3, count, 0) ) AS Mar, SUM( IF (s.contact_month = 4, count, 0) ) AS Apr, SUM( IF (s.contact_month = 5, count, 0) ) AS May, SUM( IF (s.contact_month = 6, count, 0) ) AS Jun, SUM( IF (s.contact_month = 7, count, 0) ) AS Jul, SUM( IF (s.contact_month = 8, count, 0) ) AS Aug, SUM( IF (s.contact_month = 9, count, 0) ) AS Sep, SUM( IF (s.contact_month = 10, count, 0) ) AS Oct, SUM( IF (s.contact_month = 11, count, 0) ) AS Nov, SUM( IF (s.contact_month = 12, count, 0) ) AS Decm FROM ( SELECT YEAR (i.created) AS contact_year, MONTH (i.created) AS contact_month, 1 AS count FROM contact_entity i LEFT JOIN account_entity a ON i.account_id = a.id WHERE YEAR (i.created) >= YEAR (CURDATE()) AND core_user_id IS NOT NULL AND a.is_legal_entity = 0 ) s GROUP BY s.contact_year UNION SELECT CONCAT( s.contact_year, \\\" non legal\\\" ) AS YEAR, SUM( IF (s.contact_month = 1, count, 0) ) AS Jan, SUM( IF (s.contact_month = 2, count, 0) ) AS Feb, SUM( IF (s.contact_month = 3, count, 0) ) AS Mar, SUM( IF (s.contact_month = 4, count, 0) ) AS Apr, SUM( IF (s.contact_month = 5, count, 0) ) AS May, SUM( IF (s.contact_month = 6, count, 0) ) AS Jun, SUM( IF (s.contact_month = 7, count, 0) ) AS Jul, SUM( IF (s.contact_month = 8, count, 0) ) AS Aug, SUM( IF (s.contact_month = 9, count, 0) ) AS Sep, SUM( IF (s.contact_month = 10, count, 0) ) AS Oct, SUM( IF (s.contact_month = 11, count, 0) ) AS Nov, SUM( IF (s.contact_month = 12, count, 0) ) AS Decm FROM ( SELECT YEAR (i.created) AS contact_year, MONTH (i.created) AS contact_month, 1 AS count FROM contact_entity i LEFT JOIN account_entity a ON i.account_id = a.id WHERE YEAR (i.created) >= YEAR (CURDATE()) - 1 AND YEAR (i.created) < YEAR (CURDATE()) AND core_user_id IS NOT NULL AND a.is_legal_entity = 0 ) s GROUP BY s.contact_year UNION SELECT CONCAT( s.contact_year, \\\" non legal\\\" ) AS YEAR, SUM( IF (s.contact_month = 1, count, 0) ) AS Jan, SUM( IF (s.contact_month = 2, count, 0) ) AS Feb, SUM( IF (s.contact_month = 3, count, 0) ) AS Mar, SUM( IF (s.contact_month = 4, count, 0) ) AS Apr, SUM( IF (s.contact_month = 5, count, 0) ) AS May, SUM( IF (s.contact_month = 6, count, 0) ) AS Jun, SUM( IF (s.contact_month = 7, count, 0) ) AS Jul, SUM( IF (s.contact_month = 8, count, 0) ) AS Aug, SUM( IF (s.contact_month = 9, count, 0) ) AS Sep, SUM( IF (s.contact_month = 10, count, 0) ) AS Oct, SUM( IF (s.contact_month = 11, count, 0) ) AS Nov, SUM( IF (s.contact_month = 12, count, 0) ) AS Decm FROM ( SELECT YEAR (i.created) AS contact_year, MONTH (i.created) AS contact_month, 1 AS count FROM contact_entity i LEFT JOIN account_entity a ON i.account_id = a.id WHERE YEAR (i.created) >= YEAR (CURDATE()) - 2 AND YEAR (i.created) < YEAR (CURDATE())-1 AND core_user_id IS NOT NULL AND a.is_legal_entity = 0 ) s GROUP BY s.contact_year UNION SELECT CONCAT(s.contact_year, \\\" legal\\\") AS YEAR, SUM( IF (s.contact_month = 1, count, 0) ) AS Jan, SUM( IF (s.contact_month = 2, count, 0) ) AS Feb, SUM( IF (s.contact_month = 3, count, 0) ) AS Mar, SUM( IF (s.contact_month = 4, count, 0) ) AS Apr, SUM( IF (s.contact_month = 5, count, 0) ) AS May, SUM( IF (s.contact_month = 6, count, 0) ) AS Jun, SUM( IF (s.contact_month = 7, count, 0) ) AS Jul, SUM( IF (s.contact_month = 8, count, 0) ) AS Aug, SUM( IF (s.contact_month = 9, count, 0) ) AS Sep, SUM( IF (s.contact_month = 10, count, 0) ) AS Oct, SUM( IF (s.contact_month = 11, count, 0) ) AS Nov, SUM( IF (s.contact_month = 12, count, 0) ) AS Decm FROM ( SELECT YEAR (i.created) AS contact_year, MONTH (i.created) AS contact_month, 1 AS count FROM contact_entity i LEFT JOIN account_entity a ON i.account_id = a.id WHERE YEAR (i.created) >= YEAR (CURDATE()) - 2 AND YEAR (i.created) < YEAR (CURDATE())-1 AND core_user_id IS NOT NULL AND a.is_legal_entity = 1 ) s GROUP BY s.contact_year\",\"xaxis\":[\"year\"],\"yaxis\":[{\"field\":\"Jan\",\"label\":\"Jan\",\"aggregate\":\"SUM\"},{\"field\":\"Feb\",\"label\":\"Feb\",\"aggregate\":\"SUM\"},{\"field\":\"Mar\",\"label\":\"Mar\",\"aggregate\":\"SUM\"},{\"field\":\"Apr\",\"label\":\"Apr\",\"aggregate\":\"SUM\"},{\"field\":\"May\",\"label\":\"May\",\"aggregate\":\"SUM\"},{\"field\":\"Jun\",\"label\":\"Jun\",\"aggregate\":\"SUM\"},{\"field\":\"Jul\",\"label\":\"Jul\",\"aggregate\":\"SUM\"},{\"field\":\"Aug\",\"label\":\"Aug\",\"aggregate\":\"SUM\"},{\"field\":\"Sep\",\"label\":\"Sep\",\"aggregate\":\"SUM\"},{\"field\":\"Oct\",\"label\":\"Oct\",\"aggregate\":\"SUM\"},{\"field\":\"Nov\",\"label\":\"Nov\",\"aggregate\":\"SUM\"},{\"field\":\"Decm\",\"label\":\"Dec\",\"aggregate\":\"SUM\"}],\"filters\":\"\",\"orderby\":[\"year\"],\"tooltip\":\"Displays data back 3 years\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', 'c5cb5cc639222c2accfd9e4ed4a1d946', '47d9ec11fe6a0f443edfe2dffad2ef17', 0);
INSERT INTO `page_block` VALUES (1939, 'Orders', 'report_view', '{\"datasource\":\"SELECT title, MAX(current) AS current, MAX(previous) AS previous, (IF(MAX(previous) = 0, MAX(current), MAX(current) - MAX(previous)))\\/(IF(MAX(previous) = 0, MAX(current), MAX(current) + MAX(previous))\\/2)*100 AS diff, unit FROM ( SELECT col, title, IF ( type = \'current\', val, 0 ) AS current, IF ( type = \'previous\', val, 0 ) AS previous, ord, unit FROM ( SELECT col, title, CASE WHEN col = \'order_total_count\' THEN SUM(tf.order_total_count) WHEN col = \'order_success_count\' THEN SUM(tf.order_success_count) WHEN col = \'order_canceled_count\' THEN SUM(tf.order_canceled_count) WHEN col = \'order_in_process_count\' THEN SUM(tf.order_in_process_count) WHEN col = \'quote_total_count\' THEN SUM(tf.quote_total_count) WHEN col = \'quote_to_order_rate_count\' THEN AVG(NULLIF(tf.quote_to_order_rate_count, 0)) * 100 WHEN col = \'order_total_amount\' THEN SUM(tf.order_total_amount) WHEN col = \'order_success_amount\' THEN SUM(tf.order_success_amount) WHEN col = \'order_canceled_amount\' THEN SUM(tf.order_canceled_amount) WHEN col = \'order_in_process_amount\' THEN SUM(tf.order_in_process_amount) WHEN col = \'quote_total_amount\' THEN SUM(tf.quote_total_amount) WHEN col = \'quote_to_order_rate_amount\' THEN AVG(NULLIF(tf.quote_to_order_rate_amount, 0)) * 100 END AS val, ord, unit, CASE WHEN dd.fulldate >= {date_from} AND dd.fulldate <= {date_to} THEN \'current\' WHEN dd.fulldate >= {date_from} - INTERVAL 365 DAY AND dd.fulldate <= {date_to} - INTERVAL 365 DAY THEN \'previous\' END AS type FROM ( SELECT \'order_total_count\' AS col, \'Orders\' AS title, 1 AS ord, NULL AS unit UNION ALL SELECT \'order_success_count\' AS col, \'Successful orders\' AS title, 2 AS ord, NULL AS unit UNION ALL SELECT \'order_canceled_count\' AS col, \'Canceled orders\' AS title, 3 AS ord, NULL AS unit UNION ALL SELECT \'order_in_process_count\' AS col, \'Unprocessed orders\' AS title, 4 AS ord, NULL AS unit UNION ALL SELECT \'quote_total_count\' AS col, \'Num. of carts\' AS title, 5 AS ord, NULL AS unit UNION ALL SELECT \'quote_to_order_rate_count\' AS col, \'Carts to purchases\' AS title, 6 AS ord, \'%\' AS unit UNION ALL SELECT \'order_total_amount\' AS col, \'Total revenue\' AS title, 7 AS ord, \'{default_currency_code}\' AS unit UNION ALL SELECT \'order_success_amount\' AS col, \'Successful orders revenue\' AS title, 8 AS ord, \'{default_currency_code}\' AS unit UNION ALL SELECT \'order_canceled_amount\' AS col, \'Canceled orders revenue\' AS title, 9 AS ord, \'{default_currency_code}\' AS unit UNION ALL SELECT \'order_in_process_amount\' AS col, \'Unprocessed orders revenue\' AS title, 10 AS ord, \'{default_currency_code}\' AS unit UNION ALL SELECT \'quote_total_amount\' AS col, \'Revenue in carts\' AS title, 11 AS ord, \'{default_currency_code}\' AS unit UNION ALL SELECT \'quote_to_order_rate_amount\' AS col, \'Carts to purchases revenue\' AS title, 12 AS ord, \'%\' AS unit ) ssq JOIN shape_track_totals_fact tf JOIN shape_track_date_dim dd ON tf.date_dim_id = dd.id WHERE tf.store_id IN ({store_id}) GROUP BY type, col ) sq ) q GROUP BY col ORDER BY ord ASC\",\"definition\":\"\",\"template\":\"report_view_statistics_cards.html.twig\",\"tooltip\":\"Shows data regarding to selected dates and store\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 14:15:59', 'CrmBusinessBundle', '104ed3f038d5e1f86b4ad430b6a85f17', '47d9ec11fe6a0f443edfe2dffad2ef17', 0);
INSERT INTO `page_block` VALUES (1940, 'Revenue per month including taxes and delivery costs', 'area_chart', '{\"source\":\"SELECT dd.year, SUM( IF( dd.monthnumber = 1, tf.order_total_amount, 0 ) ) AS Jan, SUM( IF( dd.monthnumber = 2, tf.order_total_amount, 0 ) ) AS Feb, SUM( IF( dd.monthnumber = 3, tf.order_total_amount, 0 ) ) AS Mar, SUM( IF( dd.monthnumber = 4, tf.order_total_amount, 0 ) ) AS Apr, SUM( IF( dd.monthnumber = 5, tf.order_total_amount, 0 ) ) AS May, SUM( IF( dd.monthnumber = 6, tf.order_total_amount, 0 ) ) AS Jun, SUM( IF( dd.monthnumber = 7, tf.order_total_amount, 0 ) ) AS Jul, SUM( IF( dd.monthnumber = 8, tf.order_total_amount, 0 ) ) AS Aug, SUM( IF( dd.monthnumber = 9, tf.order_total_amount, 0 ) ) AS Sep, SUM( IF( dd.monthnumber = 10, tf.order_total_amount, 0 ) ) AS Oct, SUM( IF( dd.monthnumber = 11, tf.order_total_amount, 0 ) ) AS Nov, SUM( IF( dd.monthnumber = 12, tf.order_total_amount, 0 ) ) AS Decm FROM shape_track_totals_fact tf JOIN shape_track_date_dim dd ON tf.date_dim_id = dd.id WHERE tf.store_id IN ({store_id}) AND dd.year > YEAR(CURDATE()) - 3 AND dd.year <= YEAR(CURDATE()) GROUP BY dd.year\",\"xaxis\":[\"year\"],\"yaxis\":[{\"field\":\"Jan\",\"label\":\"Jan\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Feb\",\"label\":\"Feb\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Mar\",\"label\":\"Mar\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Apr\",\"label\":\"Apr\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"May\",\"label\":\"May\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Jun\",\"label\":\"Jun\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Jul\",\"label\":\"Jul\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Aug\",\"label\":\"Aug\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Sep\",\"label\":\"Sep\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Oct\",\"label\":\"Oct\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Nov\",\"label\":\"Nov\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Decm\",\"label\":\"Dec\",\"aggregate\":\"SUM\",\"format\":\"currency\"}],\"filters\":\"\",\"orderby\":[\"year\"],\"tooltip\":\"Displays data back 3 years\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-03-22 00:48:04', 'CrmBusinessBundle', '8142dfbe4219df84bab7970b9edcd088', '47d9ec11fe6a0f443edfe2dffad2ef17', 0);
INSERT INTO `page_block` VALUES (1941, 'Filters', 'report_filter', NULL, NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', '46218613e0d136247719eeed7740c97a', '47d9ec11fe6a0f443edfe2dffad2ef17', 0);
INSERT INTO `page_block` VALUES (1942, 'Orders by location', 'choropleth_chart', '{\"datasource\":\"SELECT \\\"Country\\\" AS name, \\\"Popularity\\\" AS count UNION ALL SELECT JSON_UNQUOTE(JSON_EXTRACT(ce.name, \'$.\\\"4\\\"\')) AS name, COUNT(DISTINCT(oif.order_id)) AS count FROM shape_track_order_item_fact oif JOIN country_entity ce ON oif.country_id = ce.id JOIN shape_track_date_dim dd ON oif.date_dim_id = dd.id WHERE dd.fulldate >= {date_from} AND dd.fulldate <= {date_to} GROUP BY oif.country_id \",\"tooltip\":\"Shows data regarding to selected dates and store\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', 'ba53298f42af566b37f745ec537fdd1c', '47d9ec11fe6a0f443edfe2dffad2ef17', 0);
INSERT INTO `page_block` VALUES (1943, 'Most searched items', 'bubble_chart', '{\"datasource\":\"SELECT original_query as \'Name\', original_query as \'title\', times_used as \'Count\', number_of_results as \'Group\' FROM `s_product_search_results_entity` ORDER BY times_used DESC LIMIT 50\",\"tooltip\":\"\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', '5d874b6c4f7669ffdbb39ee5526f2d8a', '7b481fb4c7da729032d99bd6625fa546', 0);
INSERT INTO `page_block` VALUES (1944, 'Orders per month by status (table)', 'report_view', '{\"datasource\":\"SELECT k.order_state, CONCAT(\'[\',k.items,\']\') as items FROM (SELECT i.order_state, GROUP_CONCAT(CONCAT(\'{\\\"count\\\":\\\"\', i.order_count, \'\\\", \\\"year\\\":\\\"\',i.year,\'\\\", \\\"month_name\\\":\\\"\',i.month_name,\'\\\",\\\"month_id\\\":\\\"\',i.month_id,\'\\\"}\') ORDER BY i.ord ASC) items FROM ( SELECT order_count, calendar.month_name as month_name, calendar.month_id, b.order_state, b.year, IF ( calendar.month_id - MONTH(CURDATE()) <= 0, 12 - ABS(calendar.month_id - MONTH(CURDATE())), calendar.month_id - MONTH(CURDATE()) ) AS ord FROM ( SELECT 1 AS month_id, \\\"Jan\\\" AS month_name UNION SELECT 2 AS month_id, \\\"Feb\\\" AS month_name UNION SELECT 3 AS month_id, \\\"Mar\\\" AS month_name UNION SELECT 4 AS month_id, \\\"Apr\\\" AS month_name UNION SELECT 5 AS month_id, \\\"Mays\\\" AS month_name UNION SELECT 6 AS month_id, \\\"Jun\\\" AS month_name UNION SELECT 7 AS month_id, \\\"Jul\\\" AS month_name UNION SELECT 8 AS month_id, \\\"Aug\\\" AS month_name UNION SELECT 9 AS month_id, \\\"Sep\\\" AS month_name UNION SELECT 10 AS month_id, \\\"Oct\\\" AS month_name UNION SELECT 11 AS month_id, \\\"Nov\\\" AS month_name UNION SELECT 12 AS month_id, \\\"Dec\\\" AS month_name ) AS calendar LEFT JOIN ( SELECT order_state, dd.monthnumber AS month_id, dd.year, CASE WHEN col = \'order_success_count\' THEN SUM(tf.order_success_count) WHEN col = \'order_in_process_count\' THEN SUM(tf.order_in_process_count) WHEN col = \'order_canceled_count\' THEN SUM(tf.order_canceled_count) END AS order_count FROM ( SELECT \'order_success_count\' AS col, \'Completed\' AS order_state UNION ALL SELECT \'order_in_process_count\' AS col, \'In process\' AS order_state UNION ALL SELECT \'order_canceled_count\' AS col, \'Canceled\' AS order_state ) types JOIN shape_track_date_dim dd JOIN shape_track_totals_fact tf ON dd.id = tf.date_dim_id WHERE tf.store_id IN ({store_id}) AND dd.fulldate <= CURDATE() AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 1 YEAR) GROUP BY year, col, month_id ORDER BY year DESC, month_id ASC ) b ON calendar.month_id = b.month_id ORDER BY ord ASC ) as i WHERE i.order_state is not null GROUP BY i.order_state) k\",\"definition\":\"\",\"template\":\"orders_per_month_by_status.html.twig\",\"tooltip\":\"Displays data year back from the current month\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', '1d66db7ed6383d75379f0bdd51dc7caf', '02e3cadb6467cbc3d8745783664dc26d', 0);
INSERT INTO `page_block` VALUES (1945, 'Search with no results', 'report_view', '{\"datasource\":\"SELECT original_query as \'name\', times_used as \'count\', number_of_results as \'group\', last_regenerate_date FROM `s_product_search_results_entity` WHERE number_of_results = 0 ORDER BY times_used DESC LIMIT 50\",\"definition\":\"\",\"template\":\"report_view_search_no_results.html.twig\",\"tooltip\":\"\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', '4eed173a28ca4a5a3c24b292a5f798f1', '7b481fb4c7da729032d99bd6625fa546', 0);
INSERT INTO `page_block` VALUES (1946, 'Search most used', 'report_view', '{\"datasource\":\"SELECT original_query as \'name\', times_used as \'count\', number_of_results as \'group\', last_regenerate_date FROM `s_product_search_results_entity` ORDER BY times_used DESC LIMIT 50\",\"definition\":\"\",\"template\":\"report_view_search_most_used.html.twig\",\"tooltip\":\"\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', '944a69680fca1de760e28ad4337e7b00', '7b481fb4c7da729032d99bd6625fa546', 0);
INSERT INTO `page_block` VALUES (1947, 'Orders per month by category (table)', 'report_view', '{\"datasource\":\"SELECT k.category, CONCAT(\'[\',k.items,\']\') as items FROM ( SELECT i.category, GROUP_CONCAT(CONCAT(\'{\\\"total\\\":\\\"\', i.total, \'\\\", \\\"year\\\":\\\"\',i.dyear,\'\\\", \\\"month_name\\\":\\\"\',i.month_name,\'\\\", \\\"month_id\\\":\\\"\',i.month_id,\'\\\", \\\"last_year_total\\\":\\\"\',i.last_year_total,\'\\\", \\\"diff\\\":\\\"\',i.diff,\'\\\"}\') ORDER BY i.ord ASC) items FROM ( SELECT category, calendar.month_name, calendar.month_id, b.total, b.dyear, b.last_year_total, b.diff, IF ( calendar.month_id - MONTH(CURDATE()) <= 0, 12 - ABS( calendar.month_id - MONTH(CURDATE()) ), calendar.month_id - MONTH(CURDATE()) ) AS ord FROM ( SELECT 1 AS month_id, \\\"Jan\\\" AS month_name UNION SELECT 2 AS month_id, \\\"Feb\\\" AS month_name UNION SELECT 3 AS month_id, \\\"Mar\\\" AS month_name UNION SELECT 4 AS month_id, \\\"Apr\\\" AS month_name UNION SELECT 5 AS month_id, \\\"Mays\\\" AS month_name UNION SELECT 6 AS month_id, \\\"Jun\\\" AS month_name UNION SELECT 7 AS month_id, \\\"Jul\\\" AS month_name UNION SELECT 8 AS month_id, \\\"Aug\\\" AS month_name UNION SELECT 9 AS month_id, \\\"Sep\\\" AS month_name UNION SELECT 10 AS month_id, \\\"Oct\\\" AS month_name UNION SELECT 11 AS month_id, \\\"Nov\\\" AS month_name UNION SELECT 12 AS month_id, \\\"Dec\\\" AS month_name ) AS calendar LEFT JOIN ( SELECT JSON_UNQUOTE ( JSON_EXTRACT (pge. NAME, \'$.\\\"{default_store_id}\\\"\') ) AS category, dd.monthnumber AS month_id, SUM(pgf.order_total_amount) AS total, dd.year as dyear,COALESCE( last_year.total,0) as last_year_total, COALESCE((IF(last_year.total = 0, SUM(pgf.order_total_amount), SUM(pgf.order_total_amount) - last_year.total))\\/(IF(last_year.total = 0, SUM(pgf.order_total_amount), SUM(pgf.order_total_amount) + last_year.total)\\/2)*100,200) AS diff FROM shape_track_product_group_fact pgf JOIN shape_track_date_dim dd ON pgf.date_dim_id = dd.id JOIN product_group_entity pge ON pgf.product_group_id = pge.id LEFT JOIN (SELECT JSON_UNQUOTE ( JSON_EXTRACT (pge. NAME, \'$.\\\"{default_store_id}\\\"\') ) AS category, dd.monthnumber AS month_id, SUM(pgf.order_total_amount) AS total, dd.year as dyear, pgf.product_group_id FROM shape_track_product_group_fact pgf JOIN shape_track_date_dim dd ON pgf.date_dim_id = dd.id JOIN product_group_entity pge ON pgf.product_group_id = pge.id WHERE pgf.store_id IN ({store_id}) AND pgf.product_group_level = 1 AND ( pge.exclude_from_statistics IS NULL OR pge.exclude_from_statistics = 0 ) AND pgf.order_total_amount IS NOT NULL AND dd.fulldate <= CURDATE() - INTERVAL 1 YEAR AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 2 YEAR) GROUP BY dd.year, dd.monthnumber, pgf.product_group_id ) last_year ON month_id = last_year.month_id AND pgf.product_group_id = last_year.product_group_id WHERE pgf.store_id IN ({store_id}) AND pgf.product_group_level = 1 AND ( pge.exclude_from_statistics IS NULL OR pge.exclude_from_statistics = 0 ) AND pgf.order_total_amount IS NOT NULL AND dd.fulldate <= CURDATE() AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 1 YEAR) GROUP BY dd.year, dd.monthnumber, pgf.product_group_id ) b ON calendar.month_id = b.month_id ORDER BY ord ASC, total DESC) as i WHERE i.category is not null GROUP BY i.category) as k\",\"definition\":\"\",\"template\":\"orders_per_month_by_category.html.twig\",\"tooltip\":\"Displays data year back from the current month\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', '16d13ab8e827a6a016247cfe94484cc1', '0059a5215ffc77a57bee366becd5cfe6', 0);
