INSERT INTO `page_block` VALUES (1950, 'Orders per month by category (chart)', 'stacked_bar_chart', '{\"source\":\"SELECT category, CONCAT( calendar.month_name, \\\" \\\", b.dyear ) AS month_name, calendar.month_id, b.total, b.dyear, IF ( calendar.month_id - MONTH(CURDATE()) <= 0, 12 - ABS( calendar.month_id - MONTH(CURDATE()) ), calendar.month_id - MONTH(CURDATE()) ) AS ord FROM ( SELECT 1 AS month_id, \\\"January\\\" AS month_name UNION SELECT 2 AS month_id, \\\"February\\\" AS month_name UNION SELECT 3 AS month_id, \\\"March\\\" AS month_name UNION SELECT 4 AS month_id, \\\"April\\\" AS month_name UNION SELECT 5 AS month_id, \\\"May\\\" AS month_name UNION SELECT 6 AS month_id, \\\"June\\\" AS month_name UNION SELECT 7 AS month_id, \\\"July\\\" AS month_name UNION SELECT 8 AS month_id, \\\"August\\\" AS month_name UNION SELECT 9 AS month_id, \\\"September\\\" AS month_name UNION SELECT 10 AS month_id, \\\"October\\\" AS month_name UNION SELECT 11 AS month_id, \\\"November\\\" AS month_name UNION SELECT 12 AS month_id, \\\"December\\\" AS month_name ) AS calendar LEFT JOIN ( SELECT JSON_UNQUOTE ( JSON_EXTRACT (pge. NAME, \'$.\\\"{default_store_id}\\\"\') ) AS category, dd.monthnumber AS month_id, SUM(pgf.order_total_amount) AS total, dd.year as dyear FROM shape_track_product_group_fact pgf JOIN shape_track_date_dim dd ON pgf.date_dim_id = dd.id JOIN product_group_entity pge ON pgf.product_group_id = pge.id WHERE pgf.store_id IN ({store_id}) AND pgf.product_group_level = 1 AND ( pge.exclude_from_statistics IS NULL OR pge.exclude_from_statistics = 0 ) AND pgf.order_total_amount IS NOT NULL AND dd.fulldate <= CURDATE() AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 1 YEAR) GROUP BY dd.year, dd.monthnumber, pgf.product_group_id ) b ON calendar.month_id = b.month_id ORDER BY ord ASC, total DESC\",\"xaxis\":[\"category\",\"month_name\"],\"yaxis\":[{\"field\":\"total\",\"label\":\"Total\",\"aggregate\":\"SUM\",\"format\":\"currency\"}],\"filters\":\"\",\"orderby\":[\"ord\"],\"tooltip\":\"Displays data year back from the current month\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', 'c9ccbfdc16d292fd4d5396e4452e3cb7', 'fb83ede4bd2789acd824c45ef8b3939f', 0);
