INSERT INTO `page_block` VALUES (1955, 'Orders per month by customer type (table)', 'report_view', '{\"datasource\":\"SELECT k.customer_type, CONCAT(\'[\', k.items, \']\') AS items FROM ( SELECT i.customer_type, GROUP_CONCAT( CONCAT( \'{\\\"total\\\":\\\"\', i.total, \'\\\", \\\"year\\\":\\\"\', i.dyear, \'\\\", \\\"month_name\\\":\\\"\', i.month_name, \'\\\", \\\"month_id\\\":\\\"\', i.month_id, \'\\\", \\\"last_year_total\\\":\\\"\', i.last_year_total, \'\\\", \\\"diff\\\":\\\"\', i.diff, \'\\\"}\' ) ORDER BY i.ord ASC ) items FROM ( SELECT customer_type, calendar.month_name, calendar.month_id, b.total, b.dyear, (CASE WHEN b.last_year_total > 0 THEN b.last_year_total ELSE 0 END) as last_year_total, (CASE WHEN b.diff is null THEN 200 ELSE b.diff END) as diff, b.is_legal_entity, IF ( calendar.month_id - MONTH (CURDATE()) <= 0, 12 - ABS( calendar.month_id - MONTH (CURDATE()) ), calendar.month_id - MONTH (CURDATE()) ) AS ord FROM ( SELECT 1 AS month_id, \\\"Jan\\\" AS month_name UNION SELECT 2 AS month_id, \\\"Feb\\\" AS month_name UNION SELECT 3 AS month_id, \\\"Mar\\\" AS month_name UNION SELECT 4 AS month_id, \\\"Apr\\\" AS month_name UNION SELECT 5 AS month_id, \\\"Mays\\\" AS month_name UNION SELECT 6 AS month_id, \\\"Jun\\\" AS month_name UNION SELECT 7 AS month_id, \\\"Jul\\\" AS month_name UNION SELECT 8 AS month_id, \\\"Aug\\\" AS month_name UNION SELECT 9 AS month_id, \\\"Sep\\\" AS month_name UNION SELECT 10 AS month_id, \\\"Oct\\\" AS month_name UNION SELECT 11 AS month_id, \\\"Nov\\\" AS month_name UNION SELECT 12 AS month_id, \\\"Dec\\\" AS month_name ) AS calendar LEFT JOIN ( SELECT CASE WHEN oif.is_legal_entity = 0 THEN \'B2C\' WHEN oif.is_legal_entity = 1 THEN \'B2B\' END AS customer_type, oif.is_legal_entity AS is_legal_entity, dd.monthnumber AS month_id, dd.monthname AS month_name, dd. YEAR AS dyear, SUM(oif.base_price_total) AS total, last_year.total AS last_year_total, ( IF ( last_year.total = 0, SUM(oif.base_price_total), SUM(oif.base_price_total) - last_year.total ) ) \\/ ( IF ( last_year.total = 0, SUM(oif.base_price_total), SUM(oif.base_price_total) + last_year.total ) \\/ 2 ) * 100 AS diff FROM shape_track_order_item_fact oif JOIN shape_track_date_dim dd ON oif.date_dim_id = dd.id LEFT JOIN ( SELECT CASE WHEN oif.is_legal_entity = 0 THEN \'B2C\' WHEN oif.is_legal_entity = 1 THEN \'B2B\' END AS customer_type, oif.is_legal_entity, dd.monthnumber AS month_id, dd.monthname AS month_name, dd. YEAR AS dyear, SUM(oif.base_price_total) AS total FROM shape_track_order_item_fact oif JOIN shape_track_date_dim dd ON oif.date_dim_id = dd.id WHERE oif.is_legal_entity IS NOT NULL AND oif.store_id IN ({store_id}) AND dd.fulldate <= CURDATE() - INTERVAL 1 YEAR AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 2 YEAR) GROUP BY dd. YEAR, oif.is_legal_entity, dd.monthnumber ) last_year ON dd.monthnumber = last_year.month_id AND oif.is_legal_entity = last_year.is_legal_entity WHERE oif.is_legal_entity IS NOT NULL AND oif.store_id IN ({store_id}) AND dd.fulldate <= CURDATE() AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 1 YEAR) GROUP BY dd. YEAR, oif.is_legal_entity, dd.monthnumber ) b ON calendar.month_id = b.month_id ORDER BY ord ASC, total DESC ) AS i WHERE i.customer_type IS NOT NULL GROUP BY i.customer_type ) AS k\",\"definition\":\"\",\"template\":\"orders_per_month_by_customer_type.html.twig\",\"tooltip\":\"Displays data year back from the current month\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', 'bce225246514f0234b96b90b21a5dcea', '132aefcd50ae35bf2af6eb58f17c73c8', 0);
INSERT INTO `page_block` VALUES (1956, 'Orders per month by customer type (chart)', 'stacked_bar_chart', '{\"source\":\"SELECT customer_type, CONCAT( calendar.month_name, \\\" \\\", b.dyear ) AS month_name, b.month_id, b.total, b.dyear, IF ( calendar.month_id - MONTH (CURDATE()) <= 0, 12 - ABS( calendar.month_id - MONTH (CURDATE()) ), calendar.month_id - MONTH (CURDATE()) ) AS ord FROM ( SELECT 1 AS month_id, \\\"January\\\" AS month_name UNION SELECT 2 AS month_id, \\\"February\\\" AS month_name UNION SELECT 3 AS month_id, \\\"March\\\" AS month_name UNION SELECT 4 AS month_id, \\\"April\\\" AS month_name UNION SELECT 5 AS month_id, \\\"May\\\" AS month_name UNION SELECT 6 AS month_id, \\\"June\\\" AS month_name UNION SELECT 7 AS month_id, \\\"July\\\" AS month_name UNION SELECT 8 AS month_id, \\\"August\\\" AS month_name UNION SELECT 9 AS month_id, \\\"September\\\" AS month_name UNION SELECT 10 AS month_id, \\\"October\\\" AS month_name UNION SELECT 11 AS month_id, \\\"November\\\" AS month_name UNION SELECT 12 AS month_id, \\\"December\\\" AS month_name ) AS calendar LEFT JOIN ( SELECT CASE WHEN oif.is_legal_entity = 0 THEN \'B2C\' WHEN oif.is_legal_entity = 1 THEN \'B2B\' END AS customer_type, dd.monthnumber AS month_id, dd.monthname AS month_name, dd.year as dyear, SUM(oif.base_price_total) AS total FROM shape_track_order_item_fact oif JOIN shape_track_date_dim dd ON oif.date_dim_id = dd.id WHERE oif.is_legal_entity IS NOT NULL AND oif.store_id IN ({store_id}) AND dd.fulldate <= CURDATE() AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 1 YEAR) GROUP BY dd.year, oif.is_legal_entity, dd.monthnumber ) b ON calendar.month_id = b.month_id ORDER BY ord ASC, total DESC\",\"xaxis\":[\"customer_type\",\"month_name\"],\"yaxis\":[{\"field\":\"total\",\"label\":\"Total\",\"aggregate\":\"SUM\",\"format\":\"currency\"}],\"filters\":\"\",\"orderby\":[\"ord\"],\"tooltip\":\"Displays data year back from the current month\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', 'd2a306e58558d494d6c494cfeca8465b', '132aefcd50ae35bf2af6eb58f17c73c8', 0);
INSERT INTO `page_block` VALUES (1957, 'Orders per month by status (stacked bar chart)', 'stacked_bar_chart', '{\"source\":\"SELECT order_count, CONCAT(calendar.month_name,\\\" \\\",b.year) as month_name, calendar.month_id, b.order_state, b.year, IF ( calendar.month_id - MONTH(CURDATE()) <= 0, 12 - ABS(calendar.month_id - MONTH(CURDATE())), calendar.month_id - MONTH(CURDATE()) ) AS ord FROM ( SELECT 1 AS month_id, \\\"January\\\" AS month_name UNION SELECT 2 AS month_id, \\\"February\\\" AS month_name UNION SELECT 3 AS month_id, \\\"March\\\" AS month_name UNION SELECT 4 AS month_id, \\\"April\\\" AS month_name UNION SELECT 5 AS month_id, \\\"May\\\" AS month_name UNION SELECT 6 AS month_id, \\\"June\\\" AS month_name UNION SELECT 7 AS month_id, \\\"July\\\" AS month_name UNION SELECT 8 AS month_id, \\\"August\\\" AS month_name UNION SELECT 9 AS month_id, \\\"September\\\" AS month_name UNION SELECT 10 AS month_id, \\\"October\\\" AS month_name UNION SELECT 11 AS month_id, \\\"November\\\" AS month_name UNION SELECT 12 AS month_id, \\\"December\\\" AS month_name ) AS calendar LEFT JOIN ( SELECT order_state, dd.monthnumber AS month_id, dd.year, CASE WHEN col = \'order_success_count\' THEN SUM(tf.order_success_count) WHEN col = \'order_in_process_count\' THEN SUM(tf.order_in_process_count) WHEN col = \'order_canceled_count\' THEN SUM(tf.order_canceled_count) END AS order_count FROM ( SELECT \'order_success_count\' AS col, \'Completed\' AS order_state UNION ALL SELECT \'order_in_process_count\' AS col, \'In process\' AS order_state UNION ALL SELECT \'order_canceled_count\' AS col, \'Canceled\' AS order_state ) types JOIN shape_track_date_dim dd JOIN shape_track_totals_fact tf ON dd.id = tf.date_dim_id WHERE tf.store_id IN ({store_id}) AND dd.fulldate <= CURDATE() AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 1 YEAR) GROUP BY year, col, month_id ORDER BY year DESC ,month_id ASC ) b ON calendar.month_id = b.month_id ORDER BY ord ASC, order_count DESC\",\"xaxis\":[\"order_state\",\"month_name\"],\"yaxis\":[{\"field\":\"order_count\",\"label\":\"Orders\",\"aggregate\":\"SUM\"}],\"filters\":\"\",\"orderby\":[\"ord\"],\"tooltip\":\"Displays data year back from the current month\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', '0a53679f4f81c7476c4fe8bb82ecc0ea', '02e3cadb6467cbc3d8745783664dc26d', 0);
INSERT INTO `page_block` VALUES (1958, 'Orders per month by selected category (chart)', 'stacked_bar_chart', '{\"source\":\"SELECT category, CONCAT( calendar.month_name, \\\" \\\", b.dyear ) AS month_name, calendar.month_id, b.total, b.dyear, IF ( calendar.month_id - MONTH(CURDATE()) <= 0, 12 - ABS( calendar.month_id - MONTH(CURDATE()) ), calendar.month_id - MONTH(CURDATE()) ) AS ord FROM ( SELECT 1 AS month_id, \\\"January\\\" AS month_name UNION SELECT 2 AS month_id, \\\"February\\\" AS month_name UNION SELECT 3 AS month_id, \\\"March\\\" AS month_name UNION SELECT 4 AS month_id, \\\"April\\\" AS month_name UNION SELECT 5 AS month_id, \\\"May\\\" AS month_name UNION SELECT 6 AS month_id, \\\"June\\\" AS month_name UNION SELECT 7 AS month_id, \\\"July\\\" AS month_name UNION SELECT 8 AS month_id, \\\"August\\\" AS month_name UNION SELECT 9 AS month_id, \\\"September\\\" AS month_name UNION SELECT 10 AS month_id, \\\"October\\\" AS month_name UNION SELECT 11 AS month_id, \\\"November\\\" AS month_name UNION SELECT 12 AS month_id, \\\"December\\\" AS month_name ) AS calendar LEFT JOIN ( SELECT JSON_UNQUOTE ( JSON_EXTRACT (pge. NAME, \'$.\\\"{default_store_id}\\\"\') ) AS category, dd.monthnumber AS month_id, SUM(pgf.order_total_amount) AS total, dd.year as dyear FROM shape_track_product_group_fact pgf JOIN shape_track_date_dim dd ON pgf.date_dim_id = dd.id LEFT JOIN product_group_entity pge ON pgf.product_group_id = pge.id WHERE pgf.store_id IN ({store_id}) AND pge.include_in_custom_statistics = 1 AND pgf.order_total_amount IS NOT NULL AND dd.fulldate <= CURDATE() AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 1 YEAR) GROUP BY dd.year, dd.monthnumber, pgf.product_group_id ) b ON calendar.month_id = b.month_id ORDER BY ord ASC, total DESC\",\"xaxis\":[\"category\",\"month_name\"],\"yaxis\":[{\"field\":\"total\",\"label\":\"Total\",\"aggregate\":\"SUM\",\"format\":\"currency\"}],\"filters\":\"\",\"orderby\":[\"ord\"],\"tooltip\":\"Displays data year back from the current month\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:14', '2021-01-12 09:02:14', 'CrmBusinessBundle', '25411b33ecf499e1bb6d8215fa2d400e', '47d9ec11fe6a0f443edfe2dffad2ef17', 0);
INSERT INTO `page_block` VALUES (1959, 'Orders per month by selected category (table)', 'report_view', '{\"datasource\":\"SELECT k.category, CONCAT(\'[\',k.items,\']\') as items FROM ( SELECT i.category, GROUP_CONCAT(CONCAT(\'{\\\"total\\\":\\\"\', i.total, \'\\\", \\\"year\\\":\\\"\',i.dyear,\'\\\", \\\"month_name\\\":\\\"\',i.month_name,\'\\\", \\\"month_id\\\":\\\"\',i.month_id,\'\\\", \\\"last_year_total\\\":\\\"\',i.last_year_total,\'\\\", \\\"diff\\\":\\\"\',i.diff,\'\\\"}\') ORDER BY i.ord ASC) items FROM ( SELECT category, calendar.month_name, calendar.month_id, b.total, b.dyear, b.last_year_total, b.diff, IF ( calendar.month_id - MONTH(CURDATE()) <= 0, 12 - ABS( calendar.month_id - MONTH(CURDATE()) ), calendar.month_id - MONTH(CURDATE()) ) AS ord FROM ( SELECT 1 AS month_id, \\\"Jan\\\" AS month_name UNION SELECT 2 AS month_id, \\\"Feb\\\" AS month_name UNION SELECT 3 AS month_id, \\\"Mar\\\" AS month_name UNION SELECT 4 AS month_id, \\\"Apr\\\" AS month_name UNION SELECT 5 AS month_id, \\\"Mays\\\" AS month_name UNION SELECT 6 AS month_id, \\\"Jun\\\" AS month_name UNION SELECT 7 AS month_id, \\\"Jul\\\" AS month_name UNION SELECT 8 AS month_id, \\\"Aug\\\" AS month_name UNION SELECT 9 AS month_id, \\\"Sep\\\" AS month_name UNION SELECT 10 AS month_id, \\\"Oct\\\" AS month_name UNION SELECT 11 AS month_id, \\\"Nov\\\" AS month_name UNION SELECT 12 AS month_id, \\\"Dec\\\" AS month_name ) AS calendar LEFT JOIN ( SELECT JSON_UNQUOTE ( JSON_EXTRACT (pge. NAME, \'$.\\\"{default_store_id}\\\"\') ) AS category, dd.monthnumber AS month_id, SUM(pgf.order_total_amount) AS total, dd.year as dyear, COALESCE(last_year.total,0) as last_year_total, COALESCE((IF(last_year.total = 0, SUM(pgf.order_total_amount), SUM(pgf.order_total_amount) - last_year.total))\\/(IF(last_year.total = 0, SUM(pgf.order_total_amount), SUM(pgf.order_total_amount) + last_year.total)\\/2)*100,200) AS diff FROM shape_track_product_group_fact pgf JOIN shape_track_date_dim dd ON pgf.date_dim_id = dd.id JOIN product_group_entity pge ON pgf.product_group_id = pge.id LEFT JOIN (SELECT JSON_UNQUOTE ( JSON_EXTRACT (pge. NAME, \'$.\\\"{default_store_id}\\\"\') ) AS category, dd.monthnumber AS month_id, SUM(pgf.order_total_amount) AS total, dd.year as dyear, pgf.product_group_id FROM shape_track_product_group_fact pgf JOIN shape_track_date_dim dd ON pgf.date_dim_id = dd.id JOIN product_group_entity pge ON pgf.product_group_id = pge.id WHERE pgf.store_id IN ({store_id}) AND pge.include_in_custom_statistics = 1 AND pgf.order_total_amount IS NOT NULL AND dd.fulldate <= CURDATE() - INTERVAL 1 YEAR AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 2 YEAR) GROUP BY dd.year, dd.monthnumber, pgf.product_group_id ) last_year ON month_id = last_year.month_id AND pgf.product_group_id = last_year.product_group_id WHERE pgf.store_id IN ({store_id}) AND pge.include_in_custom_statistics = 1 AND pgf.order_total_amount IS NOT NULL AND dd.fulldate <= CURDATE() AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 1 YEAR) GROUP BY dd.year, dd.monthnumber, pgf.product_group_id ) b ON calendar.month_id = b.month_id ORDER BY ord ASC, total DESC) as i WHERE i.category is not null GROUP BY i.category) as k\",\"definition\":\"\",\"template\":\"orders_per_month_by_category.html.twig\",\"tooltip\":\"Displays data year back from the current month\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2021-01-12 09:02:15', '2021-01-12 09:02:15', 'CrmBusinessBundle', '8681d292f66abc1d596c291272bc3358', '47d9ec11fe6a0f443edfe2dffad2ef17', 0);
INSERT INTO `page_block` VALUES (1962, 'Orders per month by payment type (chart)', 'stacked_bar_chart', '{\"source\":\"SELECT JSON_UNQUOTE(JSON_EXTRACT(b.name,\'$.\\\"3\\\"\') COLLATE utf8mb4_general_ci) as payment_type, CONCAT( calendar.month_name, \\\" \\\", b.dyear ) AS month_name, b.month_id, b.total, b.dyear, IF ( calendar.month_id - MONTH (CURDATE()) <= 0, 12 - ABS( calendar.month_id - MONTH (CURDATE()) ), calendar.month_id - MONTH (CURDATE()) ) AS ord FROM ( SELECT 1 AS month_id, \\\"January\\\" AS month_name UNION SELECT 2 AS month_id, \\\"February\\\" AS month_name UNION SELECT 3 AS month_id, \\\"March\\\" AS month_name UNION SELECT 4 AS month_id, \\\"April\\\" AS month_name UNION SELECT 5 AS month_id, \\\"May\\\" AS month_name UNION SELECT 6 AS month_id, \\\"June\\\" AS month_name UNION SELECT 7 AS month_id, \\\"July\\\" AS month_name UNION SELECT 8 AS month_id, \\\"August\\\" AS month_name UNION SELECT 9 AS month_id, \\\"September\\\" AS month_name UNION SELECT 10 AS month_id, \\\"October\\\" AS month_name UNION SELECT 11 AS month_id, \\\"November\\\" AS month_name UNION SELECT 12 AS month_id, \\\"December\\\" AS month_name ) AS calendar LEFT JOIN ( SELECT CASE WHEN oif.is_legal_entity = 0 THEN \'B2C\' WHEN oif.is_legal_entity = 1 THEN \'B2B\' END AS customer_type, dd.monthnumber AS month_id, dd.monthname AS month_name, dd. YEAR AS dyear, SUM(oif.base_price_total) AS total, p.name FROM shape_track_order_item_fact oif JOIN shape_track_date_dim dd ON oif.date_dim_id = dd.id JOIN payment_type_entity p ON oif.payment_type_id = p.id WHERE oif.is_legal_entity IS NOT NULL AND oif.store_id IN ({store_id}) AND dd.fulldate <= CURDATE() AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 1 YEAR) GROUP BY dd. YEAR, oif.payment_type_id, dd.monthnumber ) b ON calendar.month_id = b.month_id ORDER BY ord ASC, total DESC\",\"xaxis\":[\"payment_type\",\"month_name\"],\"yaxis\":[{\"field\":\"total\",\"label\":\"Total\",\"aggregate\":\"SUM\",\"format\":\"currency\"}],\"filters\":\"\",\"orderby\":[\"ord\"],\"tooltip\":\"Displays data year back from the current month\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, 471, NULL, NULL, '2021-01-12 09:02:15', '2021-01-12 09:02:15', 'CrmBusinessBundle', '9074370a018430f8d45e72f76b10b6d1', '47d9ec11fe6a0f443edfe2dffad2ef17', 0);
INSERT INTO `page_block` VALUES (1963, 'Orders per month by payment type (table)', 'report_view', '{\"datasource\":\"SELECT k.payment_type, CONCAT(\'[\', k.items, \']\') AS items FROM ( SELECT i.payment_type, GROUP_CONCAT( CONCAT( \'{\\\"total\\\":\\\"\', i.total, \'\\\", \\\"year\\\":\\\"\', i.dyear, \'\\\", \\\"month_name\\\":\\\"\', i.month_name, \'\\\", \\\"month_id\\\":\\\"\', i.month_id, \'\\\", \\\"last_year_total\\\":\\\"\', i.last_year_total, \'\\\", \\\"diff\\\":\\\"\', i.diff, \'\\\"}\' ) ORDER BY i.ord ASC ) items FROM ( SELECT calendar.month_name, calendar.month_id, b.total, b.dyear, ( CASE WHEN b.last_year_total > 0 THEN b.last_year_total ELSE 0 END ) AS last_year_total, ( CASE WHEN b.diff IS NULL THEN 200 ELSE b.diff END ) AS diff, b.payment_type_id, JSON_UNQUOTE(JSON_EXTRACT(b.name,\'$.\\\"3\\\"\') COLLATE utf8mb4_general_ci) as payment_type, IF ( calendar.month_id - MONTH (CURDATE()) <= 0, 12 - ABS( calendar.month_id - MONTH (CURDATE()) ), calendar.month_id - MONTH (CURDATE()) ) AS ord FROM ( SELECT 1 AS month_id, \\\"Jan\\\" AS month_name UNION SELECT 2 AS month_id, \\\"Feb\\\" AS month_name UNION SELECT 3 AS month_id, \\\"Mar\\\" AS month_name UNION SELECT 4 AS month_id, \\\"Apr\\\" AS month_name UNION SELECT 5 AS month_id, \\\"Mays\\\" AS month_name UNION SELECT 6 AS month_id, \\\"Jun\\\" AS month_name UNION SELECT 7 AS month_id, \\\"Jul\\\" AS month_name UNION SELECT 8 AS month_id, \\\"Aug\\\" AS month_name UNION SELECT 9 AS month_id, \\\"Sep\\\" AS month_name UNION SELECT 10 AS month_id, \\\"Oct\\\" AS month_name UNION SELECT 11 AS month_id, \\\"Nov\\\" AS month_name UNION SELECT 12 AS month_id, \\\"Dec\\\" AS month_name ) AS calendar LEFT JOIN ( SELECT CASE WHEN oif.is_legal_entity = 0 THEN \'B2C\' WHEN oif.is_legal_entity = 1 THEN \'B2B\' END AS customer_type, oif.payment_type_id AS payment_type_id, dd.monthnumber AS month_id, dd.monthname AS month_name, dd. YEAR AS dyear, SUM(oif.base_price_total) AS total, last_year.total AS last_year_total, ( IF ( last_year.total = 0, SUM(oif.base_price_total), SUM(oif.base_price_total) - last_year.total ) ) \\/ ( IF ( last_year.total = 0, SUM(oif.base_price_total), SUM(oif.base_price_total) + last_year.total ) \\/ 2 ) * 100 AS diff, p.name FROM shape_track_order_item_fact oif JOIN shape_track_date_dim dd ON oif.date_dim_id = dd.id JOIN payment_type_entity p ON oif.payment_type_id = p.id LEFT JOIN ( SELECT CASE WHEN oif.is_legal_entity = 0 THEN \'B2C\' WHEN oif.is_legal_entity = 1 THEN \'B2B\' END AS customer_type, oif.payment_type_id, dd.monthnumber AS month_id, dd.monthname AS month_name, dd. YEAR AS dyear, SUM(oif.base_price_total) AS total, p.name FROM shape_track_order_item_fact oif JOIN shape_track_date_dim dd ON oif.date_dim_id = dd.id JOIN payment_type_entity p ON oif.payment_type_id = p.id WHERE oif.payment_type_id IS NOT NULL AND oif.store_id IN ({store_id}) AND dd.fulldate <= CURDATE() - INTERVAL 1 YEAR AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 2 YEAR) GROUP BY dd. YEAR, oif.payment_type_id, dd.monthnumber ) last_year ON dd.monthnumber = last_year.month_id AND oif.payment_type_id = last_year.payment_type_id WHERE oif.payment_type_id IS NOT NULL AND oif.store_id IN ({store_id}) AND dd.fulldate <= CURDATE() AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 1 YEAR) GROUP BY dd. YEAR, oif.payment_type_id, dd.monthnumber ) b ON calendar.month_id = b.month_id ORDER BY ord ASC, total DESC ) AS i WHERE i.payment_type_id IS NOT NULL GROUP BY i.payment_type_id ) AS k\",\"definition\":\"\",\"template\":\"orders_per_month_by_payment_type.html.twig\",\"tooltip\":\"Displays data year back from the current month\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, 471, NULL, NULL, '2021-01-12 09:02:15', '2021-01-12 09:02:15', 'CrmBusinessBundle', 'aaa4075a121e0a8b773e909c17311d64', '47d9ec11fe6a0f443edfe2dffad2ef17', 0);
INSERT INTO `page_block` VALUES (1964, 'Orders per month by delivery type (chart)', 'stacked_bar_chart', '{\"source\":\"SELECT JSON_UNQUOTE(JSON_EXTRACT(b.name,\'$.\\\"3\\\"\') COLLATE utf8mb4_general_ci) as delivery_type, CONCAT( calendar.month_name, \\\" \\\", b.dyear ) AS month_name, b.month_id, b.total, b.dyear, IF ( calendar.month_id - MONTH (CURDATE()) <= 0, 12 - ABS( calendar.month_id - MONTH (CURDATE()) ), calendar.month_id - MONTH (CURDATE()) ) AS ord FROM ( SELECT 1 AS month_id, \\\"January\\\" AS month_name UNION SELECT 2 AS month_id, \\\"February\\\" AS month_name UNION SELECT 3 AS month_id, \\\"March\\\" AS month_name UNION SELECT 4 AS month_id, \\\"April\\\" AS month_name UNION SELECT 5 AS month_id, \\\"May\\\" AS month_name UNION SELECT 6 AS month_id, \\\"June\\\" AS month_name UNION SELECT 7 AS month_id, \\\"July\\\" AS month_name UNION SELECT 8 AS month_id, \\\"August\\\" AS month_name UNION SELECT 9 AS month_id, \\\"September\\\" AS month_name UNION SELECT 10 AS month_id, \\\"October\\\" AS month_name UNION SELECT 11 AS month_id, \\\"November\\\" AS month_name UNION SELECT 12 AS month_id, \\\"December\\\" AS month_name ) AS calendar LEFT JOIN ( SELECT CASE WHEN oif.is_legal_entity = 0 THEN \'B2C\' WHEN oif.is_legal_entity = 1 THEN \'B2B\' END AS customer_type, dd.monthnumber AS month_id, dd.monthname AS month_name, dd. YEAR AS dyear, SUM(oif.base_price_total) AS total, p.name FROM shape_track_order_item_fact oif JOIN shape_track_date_dim dd ON oif.date_dim_id = dd.id JOIN delivery_type_entity p ON oif.delivery_type_id = p.id WHERE oif.is_legal_entity IS NOT NULL AND oif.store_id IN ({store_id}) AND dd.fulldate <= CURDATE() AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 1 YEAR) GROUP BY dd. YEAR, oif.delivery_type_id, dd.monthnumber ) b ON calendar.month_id = b.month_id ORDER BY ord ASC, total DESC\",\"xaxis\":[\"delivery_type\",\"month_name\"],\"yaxis\":[{\"field\":\"total\",\"label\":\"Total\",\"aggregate\":\"SUM\",\"format\":\"currency\"}],\"filters\":\"\",\"orderby\":[\"ord\"],\"tooltip\":\"Displays data year back from the current month\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, 471, NULL, NULL, '2021-01-12 09:02:15', '2021-01-12 09:02:15', 'CrmBusinessBundle', '6e446df912b3fafbce2b26733c6ccf8d', '47d9ec11fe6a0f443edfe2dffad2ef17', 0);
INSERT INTO `page_block` VALUES (1965, 'Orders per month by delivery type (table)', 'report_view', '{\"datasource\":\"SELECT k.delivery_type, CONCAT(\'[\', k.items, \']\') AS items FROM ( SELECT i.delivery_type, GROUP_CONCAT( CONCAT( \'{\\\"total\\\":\\\"\', i.total, \'\\\", \\\"year\\\":\\\"\', i.dyear, \'\\\", \\\"month_name\\\":\\\"\', i.month_name, \'\\\", \\\"month_id\\\":\\\"\', i.month_id, \'\\\", \\\"last_year_total\\\":\\\"\', i.last_year_total, \'\\\", \\\"diff\\\":\\\"\', i.diff, \'\\\"}\' ) ORDER BY i.ord ASC ) items FROM ( SELECT calendar.month_name, calendar.month_id, b.total, b.dyear, ( CASE WHEN b.last_year_total > 0 THEN b.last_year_total ELSE 0 END ) AS last_year_total, ( CASE WHEN b.diff IS NULL THEN 200 ELSE b.diff END ) AS diff, b.delivery_type_id, JSON_UNQUOTE(JSON_EXTRACT(b.name,\'$.\\\"3\\\"\') COLLATE utf8mb4_general_ci) as delivery_type, IF ( calendar.month_id - MONTH (CURDATE()) <= 0, 12 - ABS( calendar.month_id - MONTH (CURDATE()) ), calendar.month_id - MONTH (CURDATE()) ) AS ord FROM ( SELECT 1 AS month_id, \\\"Jan\\\" AS month_name UNION SELECT 2 AS month_id, \\\"Feb\\\" AS month_name UNION SELECT 3 AS month_id, \\\"Mar\\\" AS month_name UNION SELECT 4 AS month_id, \\\"Apr\\\" AS month_name UNION SELECT 5 AS month_id, \\\"Mays\\\" AS month_name UNION SELECT 6 AS month_id, \\\"Jun\\\" AS month_name UNION SELECT 7 AS month_id, \\\"Jul\\\" AS month_name UNION SELECT 8 AS month_id, \\\"Aug\\\" AS month_name UNION SELECT 9 AS month_id, \\\"Sep\\\" AS month_name UNION SELECT 10 AS month_id, \\\"Oct\\\" AS month_name UNION SELECT 11 AS month_id, \\\"Nov\\\" AS month_name UNION SELECT 12 AS month_id, \\\"Dec\\\" AS month_name ) AS calendar LEFT JOIN ( SELECT CASE WHEN oif.is_legal_entity = 0 THEN \'B2C\' WHEN oif.is_legal_entity = 1 THEN \'B2B\' END AS customer_type, oif.delivery_type_id AS delivery_type_id, dd.monthnumber AS month_id, dd.monthname AS month_name, dd. YEAR AS dyear, SUM(oif.base_price_total) AS total, last_year.total AS last_year_total, ( IF ( last_year.total = 0, SUM(oif.base_price_total), SUM(oif.base_price_total) - last_year.total ) ) \\/ ( IF ( last_year.total = 0, SUM(oif.base_price_total), SUM(oif.base_price_total) + last_year.total ) \\/ 2 ) * 100 AS diff, p.name FROM shape_track_order_item_fact oif JOIN shape_track_date_dim dd ON oif.date_dim_id = dd.id JOIN delivery_type_entity p ON oif.delivery_type_id = p.id LEFT JOIN ( SELECT CASE WHEN oif.is_legal_entity = 0 THEN \'B2C\' WHEN oif.is_legal_entity = 1 THEN \'B2B\' END AS customer_type, oif.delivery_type_id, dd.monthnumber AS month_id, dd.monthname AS month_name, dd. YEAR AS dyear, SUM(oif.base_price_total) AS total, p.name FROM shape_track_order_item_fact oif JOIN shape_track_date_dim dd ON oif.date_dim_id = dd.id JOIN delivery_type_entity p ON oif.delivery_type_id = p.id WHERE oif.delivery_type_id IS NOT NULL AND oif.store_id IN ({store_id}) AND dd.fulldate <= CURDATE() - INTERVAL 1 YEAR AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 2 YEAR) GROUP BY dd. YEAR, oif.delivery_type_id, dd.monthnumber ) last_year ON dd.monthnumber = last_year.month_id AND oif.delivery_type_id = last_year.delivery_type_id WHERE oif.delivery_type_id IS NOT NULL AND oif.store_id IN ({store_id}) AND dd.fulldate <= CURDATE() AND dd.fulldate > LAST_DAY(CURDATE() - INTERVAL 1 YEAR) GROUP BY dd. YEAR, oif.delivery_type_id, dd.monthnumber ) b ON calendar.month_id = b.month_id ORDER BY ord ASC, total DESC ) AS i WHERE i.delivery_type_id IS NOT NULL GROUP BY i.delivery_type_id ) AS k\",\"definition\":\"\",\"template\":\"orders_per_month_by_delivery_type.html.twig\",\"tooltip\":\"Displays data year back from the current month\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, 471, NULL, NULL, '2021-01-12 09:02:15', '2021-01-12 09:02:15', 'CrmBusinessBundle', '59dcec96ab74201a03a0e79c53f6843c', '47d9ec11fe6a0f443edfe2dffad2ef17', 0);
