INSERT INTO `page_block` VALUES (2616, 'Coupon statistics', 'report_view', '{\"datasource\":\"SELECT \'order_total_count\' AS col, \'Orders\' AS title, 1 AS ord, NULL AS unit, count(DISTINCT(order_id)) AS val FROM shape_track_order_item_fact WHERE store_id IN ({store_id}) and discount_coupon_id = {id} UNION SELECT \'order_total_amount\' AS col, \'Total revenue\' AS title, 2 AS ord, \'{default_currency_code}\' AS unit, sum(base_price_total) as val FROM shape_track_order_item_fact WHERE discount_coupon_id = {id} and store_id IN ({store_id}) UNION SELECT \'order_discount_amount\' AS col, \'Total discount\' AS title, 3 AS ord, \'{default_currency_code}\' AS unit, sum(discount_coupon_price_total) as val FROM shape_track_order_item_fact WHERE discount_coupon_id = {id} and store_id IN ({store_id}) UNION SELECT \'order_total_products_count\' AS col, \'Products count\' AS title, 4 AS ord, null AS unit, sum(qty) as val FROM shape_track_order_item_fact WHERE discount_coupon_id = {id} and store_id IN ({store_id}) AND discount_coupon_price_total > 0 UNION SELECT \'order_carts_count\' AS col, \'Quotes\' AS title, 6 AS ord, null AS unit, count(*) as val FROM quote_entity WHERE discount_coupon_id = {id} and store_id IN ({store_id}) and quote_status_id IN (1) UNION SELECT \'order_carts_amount\' AS col, \'Quotes amount\' AS title, 7 AS ord, \'{default_currency_code}\' AS unit, SUM(base_price_total) as val FROM quote_entity WHERE discount_coupon_id = {id} and store_id IN ({store_id}) and quote_status_id IN (1)\",\"definition\":\"\",\"template\":\"discount_coupon_statistics_cards.html.twig\",\"tooltip\":\"Shows data regarding to current coupon code or coupon template. If current coupon has template, this analytics is only visible on template.\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2022-07-11 21:57:31', '2022-07-11 21:57:31', 'CrmBusinessBundle', '62cc80ab941047.43729370', '7b8f6b50701cb21ef18eb0e4cf0d92b3', 0);
