INSERT INTO `page_block` VALUES (2703, '404 by date', 'area_chart', '{\"source\":\"SELECT CONCAT(YEAR(tf.created),\\\" new 404\\\") as year, SUM( IF( MONTH(tf.created) = 1, 1, 0 ) ) AS Jan, SUM( IF( MONTH(tf.created) = 2, 1, 0 ) ) AS Feb, SUM( IF( MONTH(tf.created) = 3, 1, 0 ) ) AS Mar, SUM( IF( MONTH(tf.created) = 4, 1, 0 ) ) AS Apr, SUM( IF( MONTH(tf.created) = 5, 1, 0 ) ) AS May, SUM( IF( MONTH(tf.created) = 6, 1, 0 ) ) AS Jun, SUM( IF( MONTH(tf.created) = 7, 1, 0 ) ) AS Jul, SUM( IF( MONTH(tf.created) = 8, 1, 0 ) ) AS Aug, SUM( IF( MONTH(tf.created) = 9, 1, 0 ) ) AS Sep, SUM( IF( MONTH(tf.created) = 10, 1, 0 ) ) AS Oct, SUM( IF( MONTH(tf.created) = 11, 1, 0 ) ) AS Nov, SUM( IF( MONTH(tf.created) = 12, 1, 0 ) ) AS Decm FROM s_route_not_found_entity tf WHERE tf.store_id IN ({store_id}) AND YEAR(tf.created) > YEAR(CURDATE()) - 3 AND YEAR(tf.created) <= YEAR(CURDATE()) GROUP BY YEAR(tf.created) UNION SELECT CONCAT(YEAR(tf.modified),\\\" fixed 404\\\") as year, SUM( IF( MONTH(tf.modified) = 1 AND is_redirected = 1, 1, 0 ) ) AS Jan, SUM( IF( MONTH(tf.modified) = 2 AND is_redirected = 1, 1, 0 ) ) AS Feb, SUM( IF( MONTH(tf.modified) = 3 AND is_redirected = 1, 1, 0 ) ) AS Mar, SUM( IF( MONTH(tf.modified) = 4 AND is_redirected = 1, 1, 0 ) ) AS Apr, SUM( IF( MONTH(tf.modified) = 5 AND is_redirected = 1, 1, 0 ) ) AS May, SUM( IF( MONTH(tf.modified) = 6 AND is_redirected = 1, 1, 0 ) ) AS Jun, SUM( IF( MONTH(tf.modified) = 7 AND is_redirected = 1, 1, 0 ) ) AS Jul, SUM( IF( MONTH(tf.modified) = 8 AND is_redirected = 1, 1, 0 ) ) AS Aug, SUM( IF( MONTH(tf.modified) = 9 AND is_redirected = 1, 1, 0 ) ) AS Sep, SUM( IF( MONTH(tf.modified) = 10 AND is_redirected = 1, 1, 0 ) ) AS Oct, SUM( IF( MONTH(tf.modified) = 11 AND is_redirected = 1, 1, 0 ) ) AS Nov, SUM( IF( MONTH(tf.modified) = 12 AND is_redirected = 1, 1, 0 ) ) AS Decm FROM s_route_not_found_entity tf WHERE tf.store_id IN ({store_id}) AND YEAR(tf.modified) > YEAR(CURDATE()) - 3 AND YEAR(tf.modified) <= YEAR(CURDATE()) GROUP BY YEAR(tf.modified) UNION SELECT CONCAT(YEAR(tf.created),\\\" Google indexed 404\\\") as year, SUM( IF( MONTH(tf.created) = 1, 1, 0 ) ) AS Jan, SUM( IF( MONTH(tf.created) = 2, 1, 0 ) ) AS Feb, SUM( IF( MONTH(tf.created) = 3, 1, 0 ) ) AS Mar, SUM( IF( MONTH(tf.created) = 4, 1, 0 ) ) AS Apr, SUM( IF( MONTH(tf.created) = 5, 1, 0 ) ) AS May, SUM( IF( MONTH(tf.created) = 6, 1, 0 ) ) AS Jun, SUM( IF( MONTH(tf.created) = 7, 1, 0 ) ) AS Jul, SUM( IF( MONTH(tf.created) = 8, 1, 0 ) ) AS Aug, SUM( IF( MONTH(tf.created) = 9, 1, 0 ) ) AS Sep, SUM( IF( MONTH(tf.created) = 10, 1, 0 ) ) AS Oct, SUM( IF( MONTH(tf.created) = 11, 1, 0 ) ) AS Nov, SUM( IF( MONTH(tf.created) = 12, 1, 0 ) ) AS Decm FROM s_route_not_found_entity tf WHERE tf.store_id IN ({store_id}) AND tf.google_indexed = 1 AND YEAR(tf.created) > YEAR(CURDATE()) - 3 AND YEAR(tf.created) <= YEAR(CURDATE()) GROUP BY YEAR(tf.created) UNION SELECT CONCAT(YEAR(tf.modified),\\\" Google indexed fixed 404\\\") as year, SUM( IF( MONTH(tf.modified) = 1 AND is_redirected = 1, 1, 0 ) ) AS Jan, SUM( IF( MONTH(tf.modified) = 2 AND is_redirected = 1, 1, 0 ) ) AS Feb, SUM( IF( MONTH(tf.modified) = 3 AND is_redirected = 1, 1, 0 ) ) AS Mar, SUM( IF( MONTH(tf.modified) = 4 AND is_redirected = 1, 1, 0 ) ) AS Apr, SUM( IF( MONTH(tf.modified) = 5 AND is_redirected = 1, 1, 0 ) ) AS May, SUM( IF( MONTH(tf.modified) = 6 AND is_redirected = 1, 1, 0 ) ) AS Jun, SUM( IF( MONTH(tf.modified) = 7 AND is_redirected = 1, 1, 0 ) ) AS Jul, SUM( IF( MONTH(tf.modified) = 8 AND is_redirected = 1, 1, 0 ) ) AS Aug, SUM( IF( MONTH(tf.modified) = 9 AND is_redirected = 1, 1, 0 ) ) AS Sep, SUM( IF( MONTH(tf.modified) = 10 AND is_redirected = 1, 1, 0 ) ) AS Oct, SUM( IF( MONTH(tf.modified) = 11 AND is_redirected = 1, 1, 0 ) ) AS Nov, SUM( IF( MONTH(tf.modified) = 12 AND is_redirected = 1, 1, 0 ) ) AS Decm FROM s_route_not_found_entity tf WHERE tf.store_id IN ({store_id}) AND tf.google_indexed = 1 AND YEAR(tf.modified) > YEAR(CURDATE()) - 3 AND YEAR(tf.modified) <= YEAR(CURDATE()) GROUP BY YEAR(tf.modified) \",\"xaxis\":[\"year\"],\"yaxis\":[{\"field\":\"Jan\",\"label\":\"Jan\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Feb\",\"label\":\"Feb\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Mar\",\"label\":\"Mar\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Apr\",\"label\":\"Apr\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"May\",\"label\":\"May\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Jun\",\"label\":\"Jun\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Jul\",\"label\":\"Jul\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Aug\",\"label\":\"Aug\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Sep\",\"label\":\"Sep\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Oct\",\"label\":\"Oct\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Nov\",\"label\":\"Nov\",\"aggregate\":\"SUM\",\"format\":\"currency\"},{\"field\":\"Decm\",\"label\":\"Dec\",\"aggregate\":\"SUM\",\"format\":\"currency\"}],\"filters\":\"\",\"orderby\":[\"year\"],\"tooltip\":\"Displays data back 3 years\",\"cache_tag\":\"general_statistics\"}', NULL, NULL, NULL, NULL, NULL, '2022-12-19 00:53:16', '2022-12-19 00:53:16', 'ScommerceBusinessBundle', '639fa7ec783780.23277321', '639f56e27c52a2.50662928', 0);
